import { useState, useEffect } from "react";
import Navbar from "../../components/navbar/Navbar";
import "./home.css";
import axios from "axios";


const Home = () => {

  const [post, setPost] = useState(null)
  function Submit() {
    useEffect(() => {
      axios({
        method: 'POST',
        url: `http://localhost:8800/`,
        data: {
          text: `${post}`
        }
        
      }).then(response => {
          setPost(response.data.text)
        }, (error) => {
        console.log(error);
      });}, [])
    
  }
  return (
    <div>
    <div>
      <Navbar />
      
    </div>
      <textarea type="text" value={post} onChange={(e) => setPost(e.target.value)}/>
      <button onClick={() => {Submit()}}>Create New Paste</button>
    </div>
  )
}

export default Home
